import React, { useState } from 'react';

const Chatbox = () => {
  const [message, setMessage] = useState('');
  return (
    <div>
      <input
        type='text'
        value={message}
        onChange={(e) => setMessage(e.target.value)}
      />
    </div>
  );
};

export default Chatbox;
